import logo from './logo.svg';
import './App.css';
import Loading from './Components/Lodaing/Loading';
import Card from './Components/Cards/card';
import { useEffect, useState } from 'react';
import { getData } from './Store/thunkFunction';
import { useDispatch, useSelector } from 'react-redux';

function App() {
  const dispatch=useDispatch()
  const state=useSelector((state)=>state.data)
  useEffect(()=>{
    dispatch(getData('http://localhost:3004/data'))
    console.log(state)

  },[])
  return (
    <div className="App">
      <h1>Temates name</h1>
      <div className='line'></div>
      <div className='actualdata'>
    {state.loading?<Loading></Loading>:(!state.error?<Card></Card>:<span>Eror in data</span>)}
      </div>
    </div>
  );
}

export default App;
